import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import PageM from "./components/pageM";
import DNhap from "./components/dangNhap";
import DangKy from "./components/dangKy";
import TrangChu from "./components/trangChu";
const NhaBan = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/nhaban/dangKy">
            <DangKy />
          </Route>
          <Route exact path="/nhaban/dangNhap">
            <DNhap />
          </Route>

              <Route exact path="/nhaban">
                  <TrangChu />
                </Route>
                <Route exact path="/dsSanPham">
                  <DsSanPham />
                </Route>
                <Route exact path="/dsHoaDon">
                  <DsHoaDon />
                </Route>
                <Route exact path="/doanhThu">
                  <DoanhThu />
                </Route>
                <Route exact path="/thongTinNB">
                  <ThongTinNB />
                </Route>

        </Switch>
      </div>
    </Router>
  );
};

export default NhaBan;
